answer:
Reformatted Question: In the diagram below, we have $\\sin \\angle RPQ = \\frac{7}{25}$.  What is $\\cos \\angle RPS$?

[asy]

pair R,P,Q,SS;

SS = (-2,0);

P = (0,0);

Q = (2,0);

R = rotate(aSin(7/25))*(1.5,0);

dot("$S$",SS,S);

dot("$Q$",Q,S);

dot("$R$",R,N);

dot("$P$",P,S);

draw(Q--SS);

draw(P--R);

[/asy]

Answer: Note that $\\angle RPQ$ and $\\angle RPS$ are supplementary angles, so $\\cos \\angle RPS = -\\cos \\angle RPQ$.  Since we know $\\sin \\angle RPQ = \\frac{7}{25}$, we can use the Pythagorean identity to find $\\cos \\angle RPQ$: \\begin{align*} \\sin^2 \\angle RPQ + \\cos^2 \\angle RPQ &= 1 \\\\ \\left(\\frac{7}{25}\\right)^2 + \\cos^2 \\angle RPQ &= 1 \\\\ \\cos^2 \\angle RPQ &= 1 - \\frac{49}{625} = \\frac{576}{625} \\\\ \\cos \\angle RPQ &= \\pm \\sqrt{\\frac{576}{625}} = \\pm \\frac{24}{25} \\end{align*}Since $\\angle RPQ$ is acute, we know that $\\cos \\angle RPQ$ is positive, so $\\cos \\angle RPQ = \\frac{24}{25}$.  Therefore, $\\cos \\angle RPS = -\\frac{24}{25} = \\boxed{-\\frac{24}{25}}$.

