Since the square has an area of 16 square inches, each side of the square has length $\\sqrt{16}=4$ inches.  Since all the triangles are isosceles and the figure is made up of the pieces of a Chinese tangram, the legs of the large isosceles triangle are equal to the side length of the square, or 4 inches.  Since the large isosceles triangle is made up of two smaller isosceles triangles, the legs of the smaller isosceles triangles are half the leg length of the larger isosceles triangle, or 2 inches.  Since piece "e" is a square, the side length of the square is equal to the leg length of the smaller isosceles triangle, or 2 inches.  Thus, the area of the gray piece is $\\frac{1}{2}(2)(2)=\\boxed{2}$ square inches.

