In circle $J$, $HO$ and $HN$ are tangent to the circle at $O$ and $N$. Find the number of degrees in the sum of $m\angle J$ and $m\angle H$. [asy]
size(150);
import graph;
pair J = (0,0), H = (6,0), O, N;
path circ = Circle(J,3);
pair M = midpoint(J--H);
path secCirc = Circle(M,3);
pair[] tangentPoints = intersectionpoints(circ,secCirc);
O = tangentPoints[0]; N = tangentPoints[1];
draw(J--N--H--O--cycle);
draw(circ);
label("$H$",H,E);
label("$J$",J,W);
label("$N$",N,S);
label("$O$",O,NE);
[/asy]

answer:
Reformatted Question: 
In circle $J$, $HO$ and $HN$ are tangent to the circle at $O$ and $N$. Find the number of degrees in the sum of $m\angle J$ and $m\angle H$. [asy]
size(150);
import graph;
pair J = (0,0), H = (6,0), O, N;
path circ = Circle(J,3);
pair M = midpoint(J--H);
path secCirc = Circle(M,3);
pair[] tangentPoints = intersectionpoints(circ,secCirc);
O = tangentPoints[0]; N = tangentPoints[1];
draw(J--N--H--O--cycle);
draw(circ);
label("$H$",H,E);
label("$J$",J,W);
label("$N$",N,S);
label("$O$",O,NE);
[/asy]

Answer: 
Since $HO$ and $HN$ are tangent to the circle, we know that $\angle JHO$ and $\angle JHN$ are right angles. Therefore, $\angle JHO = \angle JHN = 90^{\circ}$. Since $\angle JHO$ and $\angle JHN$ are alternate interior angles to $\angle H$, we have $\angle H = \angle JHO = \angle JHN = 90^{\circ}$. Since $\angle J$ is the central angle of circle $J$ that intercepts the same arc as $\angle H$, we have $\angle J = \frac{1}{2}\angle H = 45^{\circ}$. Therefore, the sum of $m\angle J$ and $m\angle H$ is $45^{\circ} + 90^{\circ} = \boxed{135^{\circ}}$.

