defaultpen(linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle);
pair a = (1.25,0)+1.25*dir(60);
pair b = a+1.25*dir(-60);
draw((1.25,0)--a--b--cycle);

[/asy]

Answer: 
Since the equilateral triangle has an area of the triangle equal to $16\sqrt{3}$ square centimeters, its side length $s$ satisfies the equation $\frac{s^2\sqrt{3}}{4}=16\sqrt{3}$, so $s=8$. Since the square and the equilateral triangle have equal perimeters, the side length of the square is equal to $\frac{3}{4}s=6$. Therefore, the length of a diagonal of the square is equal to $6\sqrt{2}=\boxed{6\sqrt{2}}$ centimeters.

