Answer: 
We know that the regular octahedron has 6 vertices, and the distance from $P$ to 5 of them are given as 3, 7, 8, 9, and 11. Let's denote the distance from $P$ to the sixth vertex as $x$. Since the regular octahedron is symmetric, the sum of the distances from $P$ to all 6 vertices should be equal to twice the sum of the distances from $P$ to the 3 vertices of one of its faces. We can see from the diagram that the sum of the distances from $P$ to the 3 vertices of one of its faces is $3+7+8=18$. Therefore, the sum of the distances from $P$ to all 6 vertices is $2 \times 18 = 36$. Since we already know the distances from $P$ to 5 of the vertices, we can set up the equation $3+7+8+9+11+x=36$ to solve for $x$. Solving for $x$, we get $x=36-38=\boxed{-2}$. However, since distance cannot be negative, we take the absolute value of $x$ to get the final answer of $\boxed{2}$.

